import SignatureDish from '../signature-dishes/SignatureDishes';
import { Fragment } from 'react';

const DUMMY_DATA = [
    {
      id: '1',
      restaurantName: 'Claro',
      signatureName: '',
      signatureImage: '',
      description: '',
      icon: '',
      price: 2
    },
    {
      id: '2',
      restaurantName: 'Lumina',
      signatureName: '',
      signatureImage: '',
      description: '',
      icon: '',
      price: 25
    },
    {
      id: '3',
      restaurantName: 'Tiger Lilly',
      signatureName: '',
      signatureImage: '',
      description: '',
      icon: '',
      price: 4
    }
  ];


  const DummyData= () => {
      const signatureList= DUMMY_DATA.map((dish) => (<SignatureDish key={dish.id}  restaurantName={dish.restaurantName} signatureName={dish.signatureName} signatureImage={dish.signatureImage} description={dish.description} icon={dish.icon} price={dish.price} />));

      return(
        <Fragment>
          <div className='popular-container'>
            {signatureList}
          </div>
        </Fragment>

      )
  }

  export default DummyData;
